        // ConstArray<T>
        public struct ConstArray<T> : IEnumerable<T>
        {
            private readonly T[] m_data;

            public ConstArray(params T[] data)
            {
                m_data = (T[])data.Clone();
            }

            public T this[int i]
            {
                [MethodImpl(MethodImplOptions.AggressiveInlining)]
                get { return m_data[i]; }
            }

            public int Length
            {
                [MethodImpl(MethodImplOptions.AggressiveInlining)]
                get { return m_data.Length; }
            }

            public override bool Equals(Object other)
            {
                if(other.GetType().Equals(typeof(ConstArray<T>)))
                {
                    return m_data.SequenceEqual((ConstArray<T>)other);
                }
                return false;
            }

            public override int GetHashCode()
            {
                int hashCode = 0;
                foreach(T element in m_data)
                {
                    hashCode = hashCode ^ element.GetHashCode();
                }
                return hashCode;
            }

            [MethodImpl(MethodImplOptions.AggressiveInlining)]
            public IEnumerator<T> GetEnumerator()
            {
                return new ConstArrayEnum<T>(this);
            }

            [MethodImpl(MethodImplOptions.AggressiveInlining)]
            IEnumerator IEnumerable.GetEnumerator()
            {
                return new ConstArrayEnum<T>(this);
            }

            // ConstArray Enumerator
            private struct ConstArrayEnum<U> : IEnumerator<U>
            {
                private int index;
                private readonly ConstArray<U> data;

                public ConstArrayEnum(ConstArray<U> data)
                {
                    index = -1;
                    this.data = data;
                }

                U IEnumerator<U>.Current
                {
                    [MethodImpl(MethodImplOptions.AggressiveInlining)]
                    get { return data[index]; }
                }

                public object Current
                {
                    [MethodImpl(MethodImplOptions.AggressiveInlining)]
                    get { return data[index]; }
                }

                [MethodImpl(MethodImplOptions.AggressiveInlining)]
                public bool MoveNext()
                {
                    return (++index < data.Length);
                }

                [MethodImpl(MethodImplOptions.AggressiveInlining)]
                public void Reset()
                {
                    index = -1;
                }

                [MethodImpl(MethodImplOptions.AggressiveInlining)]
                public void Dispose() { }
            }
        }

